import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { 
  DocumentTextIcon, 
  ShieldCheckIcon, 
  BellIcon, 
  UserCircleIcon, 
  ComputerDesktopIcon,
  ChartBarIcon,
  ExclamationTriangleIcon,
  CheckCircleIcon,
  XCircleIcon,
  CogIcon,
  LockClosedIcon,
  ServerIcon,
  ExclamationCircleIcon,
  ClockIcon,
  DocumentDuplicateIcon,
  MagnifyingGlassIcon,
  PlayIcon,
  StopIcon,
  EyeIcon,
  ChartPieIcon,
  GlobeAltIcon,
  WifiIcon,
  CloudIcon,
  KeyIcon,
  UserGroupIcon,
  Cog6ToothIcon,
  CommandLineIcon,
  BoltIcon,
  ShieldExclamationIcon,
  FireIcon
} from '@heroicons/react/24/outline';

interface SIEMSOARData {
  overview: {
    totalLogs: number;
    activeAlerts: number;
    openIncidents: number;
    securityScore: number;
  };
  logCollection: {
    totalSources: number;
    logsPerSecond: number;
    storageUsed: number;
    status: 'healthy' | 'warning' | 'critical';
  };
  eventCorrelation: {
    correlationRules: number;
    activeRules: number;
    eventsCorrelated: number;
